import React, { useState } from 'react';
import { Link } from 'react-router-dom';

function Home() {
  const [isHover,setIsHover]=useState(false);
  const MouseIn=()=>{
    setIsHover(true)
  }
  const MouseOut=()=>{
    setIsHover(false)
  }
  return (
    <section className="page">
      <div className=" h-screen flex w-screen justify-center items-center bg">
        <div className={`backdrop-blur-md flex flex-col items-center justify-center h-screen w-screen $ p-4 rounded-lg relative `}>
          <h1 className="text-6xl white font-bold  ">Bienvenue à la Clinique du Diabète</h1>
          <p className="text-gray-200">Nous sommes fiers de vous présenter la Clinique du Diabète, votre destination de confiance pour des soins spécialisés ambulatoires de haute qualité. Notre équipe dévouée est là pour vous accompagner tout au long de votre parcours, que vous soyez atteint de diabète de type 1, de type 2 ou de diabète gestationnel. Chez nous, la santé et le bien-être de nos patients sont notre priorité absolue.</p>
          <Link className="bg-blue-500 text-white p-2" to="/Contact">
            Contact Us
          </Link>
        </div>
      </div>
      <div className="h-screen w-screen bg-white z-10"></div>
    </section>
  );
}

export default Home;
